// Initialize an empty object to store filtered items
let filteredData = {};

// Loop through each item in $input.item.json.data
for (const item in $input.item.json.data) {
  // Check if the item is not an array
  if (!Array.isArray($input.item.json.data[item])) {
    // Add the item to the filteredData object
    filteredData[item] = $input.item.json.data[item];
  }
}
filteredData['row_number'] = $('Pull linkedin profiles').first().json.row_number
// Return the filteredData array
return filteredData;
